import React, { useState } from "react";
import { Form, Button } from "react-bootstrap";
import { PROFILE_SERVICE } from "../api/service";

const CreateProfile = () => {
  const [formData, setFormData] = useState({
    status: "",
    company: "",
    website: "",
    location: "",
    skills: "",
    githubUsername: "",
    bio: "",
  });

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await PROFILE_SERVICE({
        company: formData.company,
        website: formData.website,
        location: formData.location,
        status: formData.status,
        skills: formData.skills,
        bio: formData.bio,
        githubUsername: formData.githubUsername,
      });
      console.log(res);
    } catch (error) {
      console.error(error);
    }
  };

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  return (
    <>
      <Form onSubmit={handleSubmit}>
        <Form.Group>
          <Form.Label>Select Professional Status</Form.Label>
          <Form.Control as="select" name="status" onChange={handleChange}>
            <option value="Developer">Developer</option>
            <option value="Junior Developer">Junior Developer</option>
            <option value="Senior Developer">Senior Developer</option>
            <option value="Manager">Manager</option>
            <option value="Student or Learning">Student or Learning</option>
            <option value="Instructor">Instructor or Teacher</option>
            <option value="Intern">Intern</option>
            <option value="Other">Other</option>
          </Form.Control>
        </Form.Group>
        <Form.Group controlId="formBasicEmail">
          <Form.Label>Company</Form.Label>
          <Form.Control type="text" name="company" onChange={handleChange} />
        </Form.Group>
        <Form.Group controlId="formBasicCompany">
          <Form.Label>Website</Form.Label>
          <Form.Control type="text" name="website" onChange={handleChange} />
        </Form.Group>
        <Form.Group controlId="formBasicLocation">
          <Form.Label>Location</Form.Label>
          <Form.Control type="text" name="location" onChange={handleChange} />
        </Form.Group>
        <Form.Group controlId="formBasicSkills">
          <Form.Label>Skills</Form.Label>
          <Form.Control type="text" name="skills" onChange={handleChange} />
        </Form.Group>
        <Form.Group controlId="formBasicGusername">
          <Form.Label>Github Username</Form.Label>
          <Form.Control
            type="text"
            name="githubUsername"
            onChange={handleChange}
          />
        </Form.Group>
        <Form.Group controlId="bio">
          <Form.Label>Tell us a bit about yourself</Form.Label>
          <Form.Control as="textarea" name="bio" onChange={handleChange} />
        </Form.Group>
        <Button variant="primary" type="submit">
          Add Profile
        </Button>
      </Form>
    </>
  );
};

export default CreateProfile;
